import Link from "next/link";

const layoutStyle = {
    paddingLeft: 20,
    paddingRight: 20,
    background: 'rgb(25,26,26)',
    height: '100%'
};


const Header = () => (
    <div className="menu" style={{ display: 'flex', flexDirection: 'row', width: '30%', color: 'white', height: '32%' }}>
        <Link href="/">
            <a><h5 style={{ color: 'white' }}>Tracker</h5></a>
        </Link>
        <Link href="/news">
            <a><h5 style={{ color: 'white' }}>News</h5></a>
        </Link>
        <Link href="/news">
            <a><h5 style={{ color: 'white' }}>Gaming</h5></a>
        </Link>
        <Link href="/news">
            <a><h5 style={{ color: 'white' }}>Stock Market</h5></a>
        </Link>
        <Link href="/news">
            <a><h5 style={{ color: 'white' }}>Free Courses</h5></a>
        </Link>
        <style jsx>{`
            .menu:not(:first-child) {
                background-color:red;
             }
        `}</style>
    </div>
)

export default function Layout({ children }) {
    return (
        <div style={layoutStyle}>
            <Header />
            {children}
        </div>
    )
}
